package com.mofang.feed.model.external;

/**
 * 
 * @author zhaodx
 *
 */
public class Game
{
	private int gameId;
	private String icon;
	private String name;

	public int getGameId() {
		return gameId;
	}

	public void setGameId(int gameId) {
		this.gameId = gameId;
	}

	public String getIcon() {
		return icon;
	}

	public void setIcon(String icon) {
		this.icon = icon;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	
}